package hackerrank.strings

const val validString1 = "abcdefghhgfedecba"
const val validString2 = ""
const val invalidString1 = "aabbcd"
const val invalidString2 = "aabbccddeefghi"

fun main(args: Array<String>) {
    println(isValid(validString1))
//    println(isValid(validString2))
    println()
    println(isValid(invalidString1))
    println(isValid(invalidString2))
}

// Complete the isValid function below.
fun isValid(s: String): String {
    val yes = "YES"
    val no = "NO"

    val map = mutableMapOf<Char, Int>()

    s.forEach { map[it] = ((map[it] ?: 0) + 1) }
//    println(map)

    var diff: Int = 0

    var firstValue: Int? = null

    for ((_, value) in map) {

        if (firstValue == null) {
            firstValue = value
            continue
        }

        if (firstValue != value) {
            diff += Math.abs(firstValue - value)
        }
    }

    return if (diff <= 1) yes else no
}
